import { Table } from 'react-bootstrap'

const SeoTable = ({content}) => {

  const renderTable = () => {
    return (
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>URL</th>
            <th>1st Category</th>
            <th>City</th>
          </tr>
        </thead>
      </Table>
    )
  }

  return renderTable()
}

export default SeoTable
